DELETE FROM `page_text` WHERE `ID` IN (4602, 4601, 4605, 4610);
INSERT INTO `page_text` (`ID`, `Text`, `NextPageID`, `VerifiedBuild`) VALUES
(4602, '"Goodnight, Shen-zin Su. Do not mourn, old friend. I sleep, and when I awaken, my next great journey begins." -Liu Lang$b$b     This location marks the final resting place of Liu Lang, the first pandaren explorer. Weary from a lifetime of travels, he rested under the shade of his trusted bamboo umbrella and drifted to what lies beyond.$b$b     According to legend, the unusual tree growing in this spot sprouted from that very umbrella, and his spirit has merged with the lands on Shen-zin Su''s back.$b$b     In the generations that followed, many of the island''s elders have followed, each planting his or her staff in the ground to create the "Wood of Staves."', 0, 20886), -- 4602
(4601, '"Every horizon is a treasure chest; Every blank map a story waiting to be told." -Liu Lang$b$b     The first pandaren explorer, Liu Lang disembarked from the mainland on the back of the great turtle Shen-zin Su. His discoveries proved that the rest of the world had survived the Sundering.$b$b     He would return to Pandaria every five years, gathering more wanderers and explorers with each visit, until his death at the age of 122. The turtle Shen-zin Su has not returned to Pandaria since.', 0, 20886), -- 4601
(4605, '"Discipline is not a war that is won. It is a battle, constantly fought." -Master Feng$b$bThe way of the Tushui is one of a principled life. Followers of this discipline  believe there is a moral certainty to the world: one correct path of right and wrong.$b$bThese values are immutable, and must be preserved no matter what the cost, even if it means self-sacrifice, or painful losses in the pursuit of a higher ideal.', 0, 20886), -- 4605
(4610, '"Always challenge. Always question. In the pursuit of a greater good, inaction is the only wrong." -Master Zurong$b$bThe path of the Huojin is marked by practical and decisive action. Followers of this discipline believe that morals and ideals are not absolute, but change with circumstances.$b$bAs such, a Huojin Master must remain flexible in his or her thinking, always evaluating the greater good.', 0, 20886); -- 4610

