INSERT INTO `creature_text` (`CreatureID`, `GroupID`, `ID`, `Text`, `Type`, `Language`, `Probability`, `Emote`, `Duration`, `Sound`, `BroadcastTextId`, `TextRange`, `comment`) VALUES
(3296, 6, 0, 'Never thought I''d see one of your kind walk through here.', 12, 0, 100, 66, 0, 0, 61626, 0, 'Orgrimmar Grunt to Player'),
(3296, 7, 0, 'Come on through. The Warchief''s expecting you.', 12, 0, 100, 1, 0, 0, 61627, 0, 'Orgrimmar Grunt to Player'),
(62195, 0, 0, 'Look! It''s Ji Firepaw and $p!', 14, 0, 100, 66, 0, 0, 61628, 0, 'Shang''gok to Player'),
(62195, 1, 0, 'They''re the ones who helped Korga Strongmane escape from the Alliance!', 12, 0, 100, 66, 0, 0, 61629, 0, 'Shang''gok to Player'),
(62087, 0, 0, 'You''ve made a wise decision to join my Horde.', 12, 0, 100, 273, 0, 30746, 61586, 0, 'Garrosh Hellscream to Player'),
(62087, 1, 0, 'There are some that would call us barbarians... the "mongrel races" of Azeroth.', 12, 0, 100, 396, 0, 30747, 61587, 0, 'Garrosh Hellscream to Player'),
(62087, 2, 0, 'They are ignorant, and blind to reality. Look around you, pandaren.', 12, 0, 100, 274, 0, 30748, 61588, 0, 'Garrosh Hellscream to Player'),
(62087, 3, 0, 'You will find no better partner in battle than an orc.', 12, 0, 100, 397, 0, 30749, 61589, 0, 'Garrosh Hellscream to Player'),
(62087, 4, 0, 'The tauren have made themselves useful. Look - this one is a shaman.', 12, 0, 100, 6, 0, 30750, 61590, 0, 'Garrosh Hellscream to Player'),
(62087, 5, 0, 'Even a blood elf can hold a sword.', 12, 0, 100, 396, 0, 30751, 61592, 0, 'Garrosh Hellscream to Player'),
(62087, 6, 0, 'Do you see it? Everyone in my Horde earns their keep. You and your friends will be no exception.', 12, 0, 100, 396, 0, 30752, 61593, 0, 'Garrosh Hellscream to Player'),
(62087, 7, 0, 'Do you understand this, pandaren?', 12, 0, 100, 6, 0, 30753, 61594, 0, 'Garrosh Hellscream to Player'),
(62087, 8, 0, 'Hm. Good.', 12, 0, 100, 0, 0, 30754, 61596, 0, 'Garrosh Hellscream to Player'),
(62087, 9, 0, 'Moving on. I know that you are not the only pandaren to escape from that island.', 12, 0, 100, 396, 0, 30755, 61597, 0, 'Garrosh Hellscream to Player'),
(62087, 10, 0, 'Some of your kind chose to join the Alliance.', 12, 0, 100, 14, 0, 30756, 61598, 0, 'Garrosh Hellscream to Player'),
(62087, 11, 0, 'They are now your enemies.', 12, 0, 100, 397, 0, 30757, 61599, 0, 'Garrosh Hellscream to Player'),
(62087, 12, 0, 'You may have had friends and kin who chose to cast their lot with the enemies of the Horde. They are no longer your friends... no longer your family.', 12, 0, 100, 396, 0, 30758, 61600, 0, 'Garrosh Hellscream to Player'),
(62087, 13, 0, 'The minute they put on that Alliance tabard, they died. I will NOT tolerate any lingering ties across enemy lines. Traitors to the Horde will die a traitor''s death!', 12, 0, 100, 274, 0, 30759, 61601, 0, 'Garrosh Hellscream to Player'),
(62087, 14, 0, 'Do I make myself clear?', 12, 0, 100, 5, 0, 30760, 61602, 0, 'Garrosh Hellscream to Player'),
(62087, 15, 0, 'Good.', 12, 0, 100, 0, 0, 30761, 61604, 0, 'Garrosh Hellscream to Player'),
(62087, 16, 0, 'Meet me in the Valley of Honor. I have a gift for you.', 12, 0, 100, 396, 0, 30762, 61605, 0, 'Garrosh Hellscream to Player'),
(62081, 0, 0, 'Look at this!', 12, 0, 100, 5, 0, 0, 61630, 0, 'Ji Firepaw to Player'),
(62081, 1, 0, 'Well, that''s good news. Once we join the Horde, we certainly won''t run out of things to do.', 12, 0, 100, 1, 0, 0, 61631, 0, 'Ji Firepaw to Player'),
(62081, 2, 0, 'Emperor Hellscream, I am Ji...', 12, 0, 100, 1, 0, 27289, 61633, 0, 'Ji Firepaw to Player'),
(62081, 3, 0, 'Yes, warchief.', 12, 0, 100, 2, 0, 27290, 61595, 0, 'Ji Firepaw to Garrosh Hellscream'),
(62081, 4, 0, 'I... I believe so. Yes.', 12, 0, 100, 273, 0, 27291, 61603, 0, 'Ji Firepaw to Garrosh Hellscream');

